import React from 'react'


export default class Checkbox extends React.Component {

    render() {
        return (
            <div>
                <label>{this.props.label}</label>            
                {<input type="checkbox" onChange={this.props.onChange}/>}
                <label>{this.props.label}</label>
            </div>
        )
    }
}
